import React, { useState } from "react";
import HeaderBar from "@components/header"
import { useHistory } from "react-router-dom";
import { Picker, List, Toast } from "antd-mobile"
import './style.scss'
const OffTimer = () => {
   const { goBack } = useHistory();
   const [selectValue, setSelectValue] = useState<string>();
   const [imgUrl, setImgUrl] = useState("")
   const sumbit = () => {
      if (selectValue === "1" && !imgUrl) {
         Toast.info("需要上传凭证")
         return;
      }
   }
   return (
      <>
         <HeaderBar goback={goBack} title={"取消付款"} />
         <p className="select-wrap">
            <span>取消原因*</span>
            <select className="select" onChange={(e) => setSelectValue(e.target.value)}>
               <option value="1">收款账号异常</option>
               <option value="2">自身资金不足</option>
               <option value="3">其他</option>
            </select>
         </p>
         <p className="select-wrap">
            <span>说明*</span>
            <textarea rows={4} className="select">

            </textarea>
         </p>
         <div className="timer-update">
            <p className="vlidate"><span>*</span>上传凭证</p>
            <p>
               <span className="update-img">
                  <input type="file" accept="image/png, image/jpeg, image/gif, image/jpg" multiple={false} onChange={(e) => { }} />
               </span>
            </p>
         </div>
         <p className="submit-btn">提交</p>
      </>

   )
}
export default OffTimer;
